insert into T_GENM_CRITERIO (id_criterio, nombre, descripcion, archivo_base, archivo_tipo, flag_estado, reg_usuario, reg_fecha, upd_usuario, upd_fecha)
values (1, 'Ahorro de energía eléctrica total', 'Es el reconocimiento que se le da a la organización pública o privada que ha medido su ahorro energético (mínimo 1 año) después de la implementación de mejora de eficiencia energética. Este porcentaje de ahorro es el consumo reducido por la medida implementada respecto al consumo total de energía eléctrica de la organización. Este reconocimiento brinda puntaje para alcanzar la categoría deseada y a su vez brinda puntaje para la obtención de estrellas que permite reconocer como han logrado reducir sus emisiones de Gases de Efecto Invernadero (GEI) en beneficio del ambiente.', 'criterio-01.png', null, '1', null, to_date('05-10-2020 14:00:49', 'dd-mm-yyyy hh24:mi:ss'), null, null);
insert into T_GENM_CRITERIO (id_criterio, nombre, descripcion, archivo_base, archivo_tipo, flag_estado, reg_usuario, reg_fecha, upd_usuario, upd_fecha)
values (2, 'Ahorro de consumo de combustible', 'Es el reconocimiento que se le da a la organización pública o privada que ha medido su ahorro de combustible (mínimo 1 año) obtenida a partir de una implementación de mejora de eficiencia energética. Este porcentaje de ahorro es el consumo reducido por la medida implementada respecti al consumo total de combustible de la organzación. Este reconocimiento brinda puntaje para alcanzar la categoría deseada y a su vez brinda puntaje para la obtención de estrellas que permite reconocer como han logrado reducir sus emisiones de Gases de Efecto Invernadero (GEI) en beneficio del ambiente.', 'criterio-02.png', null, '1', null, to_date('05-10-2020 14:00:49', 'dd-mm-yyyy hh24:mi:ss'), null, null);
insert into T_GENM_CRITERIO (id_criterio, nombre, descripcion, archivo_base, archivo_tipo, flag_estado, reg_usuario, reg_fecha, upd_usuario, upd_fecha)
values (3, 'Incorporación de vehículos eléctricos', null, 'criterio-09.png', null, '1', null, to_date('05-10-2020 14:00:49', 'dd-mm-yyyy hh24:mi:ss'), null, null);
insert into T_GENM_CRITERIO (id_criterio, nombre, descripcion, archivo_base, archivo_tipo, flag_estado, reg_usuario, reg_fecha, upd_usuario, upd_fecha)
values (4, 'Implementación de un sistema de gestión de la energía', 'Es el reconocimiento que se le da a la organización pública o privada que se encuentre en el camino de la optimización del uso de la energía con el fin de buscar el uso racional y eficiente de la energía. A través de la gestión energética se detectan oportunidades de mejora en acpectos relacionados con la calidad y seguridad de los sistemas energéticos, logrando que los usuarios conozcan el sistema, identifiquen los puntos de consumo e implmentar mejoras, alcanzando altos niveles de eficiencia energética, en ese sentido el presente reconocimiento se les dará a las organizaciones que se establezcan una política y unos objetivos energéticos, para alcanzar dichos objetivos. Este reconocimiento solo brinda puntaje para alcanzar la categoría deseada.', 'criterio-04.png', null, '1', null, to_date('05-10-2020 14:00:49', 'dd-mm-yyyy hh24:mi:ss'), null, null);
insert into T_GENM_CRITERIO (id_criterio, nombre, descripcion, archivo_base, archivo_tipo, flag_estado, reg_usuario, reg_fecha, upd_usuario, upd_fecha)
values (5, 'Diagnóstico energético', 'Es el reconocimiento que se le da a la organización pública o privada por la realizaciónde de auditorías energéticas en cualquiera de sus tres niveles de esfuerzo, la cual debe haber sido realizada hasta dos (02) años de antiguedad con respecto a la fehca de su postulación. Este reconocimiento solo brinda puntaje para alcanzar la categoría deseada.', 'criterio-05.png', null, '1', null, to_date('05-10-2020 14:00:49', 'dd-mm-yyyy hh24:mi:ss'), null, null);
insert into T_GENM_CRITERIO (id_criterio, nombre, descripcion, archivo_base, archivo_tipo, flag_estado, reg_usuario, reg_fecha, upd_usuario, upd_fecha)
values (6, 'Fortalecimiento de capacidades para el buen uso de la energía', 'Es el reconocimiento que se le da a la organización pública o privada por la realización de actividades de promoción y difusión del uso de la energía y cambio climático en sus intalaciones. Este reconocimiento solo brinda puntaje para alcanzar la categoría deseada.', 'criterio-07.png', null, '1', null, to_date('05-10-2020 14:00:49', 'dd-mm-yyyy hh24:mi:ss'), null, null);
insert into T_GENM_CRITERIO (id_criterio, nombre, descripcion, archivo_base, archivo_tipo, flag_estado, reg_usuario, reg_fecha, upd_usuario, upd_fecha)
values (7, 'Generación de puestos de trabajo relacionado a la gestión de la energía', 'Es el reconocimiento que se le da a la organización pública o privada que cuente con personal a tiempo completo con funciones relacionadas a la gestión de la energía, como resultado de la iniciativa o proyecto para la implementación de una medida de eficiencia energética. Este reconocimiento solo brinda puntaje para alcanzar la categoría deseada.', 'criterio-03.png', null, '1', null, to_date('05-10-2020 14:00:49', 'dd-mm-yyyy hh24:mi:ss'), null, null);
